import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 45.2-1121  Reexamination.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/45.2-1121.md","filePath":"vacode/45.2-1121.md"}'),i={name:"vacode/45.2-1121.md"},o=r('<h1 id="§-45-2-1121-reexamination" tabindex="-1">§ 45.2-1121 Reexamination. <a class="header-anchor" href="#§-45-2-1121-reexamination" aria-label="Permalink to &quot;§ 45.2-1121  Reexamination.&quot;">​</a></h1><p>The holder of a certificate revoked pursuant to § <a href="/vacode/45.2-1120/">45.2-1120</a> is entitled to examination by the Department after a period of three months has elapsed from the date of revocation of the certificate if he can prove to the satisfaction of the Department that the cause for revocation of his certificate has ceased to exist.</p><p>1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0390" target="_blank" rel="noreferrer">390</a>, § 45.1-161.292:27; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0803" target="_blank" rel="noreferrer">803</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0835" target="_blank" rel="noreferrer">835</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0387" target="_blank" rel="noreferrer">387</a>.</p>',3),n=[o];function c(s,f,l,h,_,p){return a(),t("div",null,n)}const m=e(i,[["render",c]]);export{g as __pageData,m as default};
